import React from 'react';
import './todo-list-items';


const TodoListItems = ( {label, important = false} ) => {

    const style = {
        color: important ? 'red': 'black'
    };

    return(
        <span className ='todo-list-items'>
            <span style = {style}> { label } </span>
        </span>
    )
};

export default TodoListItems;
